import React, { useState } from "react";
import { Link } from "react-router-dom";
import Typewrier from "typewriter-effect";

function Home() {
  const [instructiune, setInstructiune] = useState(false);

  let style = {
    width: 0,
    minHeight: 0,
  };

  function big() {
    style = {
      width: "600px",
      minHeight: "500px",
    };
  }

  return (
    <>
      <div className="fullPage ">
        <div className="thoborBackground">
          <div className="banner">
            <h1>
              <Typewrier
                onInit={(type) => {
                  type
                    .typeString(
                      "Bine ai venit la tresure hunt-ul organizat de Thobor"
                    )
                    .start();
                }}
              />
            </h1>
          </div>
        </div>

        {instructiune && big()}

        <div className="info" style={style}>
          <i
            class="far fa-times-circle"
            onClick={() => setInstructiune(false)}
          ></i>
          <div className="text">
            lorem3000
          </div>
        </div>

        <div className="optiuni">
          <div className="start o">
            <h2>
              <Link to>Start</Link>
            </h2>
          </div>
          <div className="instructiuni o">
            <h2
              onClick={() => {
                setInstructiune(true);
              }}
            >
              instructiuni
            </h2>
          </div>
        </div>
      </div>
    </>
  );
}

export default Home;
